import React from 'react'
import {AiTwotoneMail, AiTwotonePhone } from 'react-icons/ai'

export default function Contact() {
  return (
    <div className='flex flex-col items-center'>
        <h3 className='dark:text-white text-black text-4xl'>Contact</h3>
        <div className='flex space-x-4'>
            <p className='dark:text-gray-50 text-black flex'><AiTwotoneMail/> tesfatsionshiferaw@bennington.edu</p>
            <p className='dark:text-gray-50 text-black flex'><AiTwotonePhone/>(802)-112-1234</p>
        </div>
    </div>
  )
}
